import React from 'react'
import { Head } from '../Components/Styled'
import { ReactComponent as Logo } from '../../public/logo.svg';

function Header(props) {
  return (
    <Head>
        <div> <img alt='logo' src={<Logo />} /> </div>
        <h3>{props.info}</h3>
    </Head>
  )
}

export default Header
